import React, { Component } from "react";


class Come extends Component {

  render() {

    return (
        <div className="row" id="fond5">
            <div className="col-md-2">
            </div>
            <div className="col-md-10">
                <center><h3>Welcome</h3></center> 
                <center><h1>Gasy Ecocitizen</h1></center>
                <center><img alt="Image logo" src="img/logo.png" id="sary1"/></center>
            </div>
        </div>



    );
  }
}

export default Come;
